def initcmap():
    for name in diverging:
        if name not in colormaps:
            colormaps.register(LinearSegmentedColormap.from_list(name, diverging[name]))
    for name in seq:
        if name not in colormaps:
            colormaps.register(LinearSegmentedColormap.from_list(name, seq[name]))
    for name in pal:
        if name not in colormaps:
            colormaps.register(ListedColormap(pal[name], name = name))
    #print(list(colormaps._cmaps.keys()))

def get_cmap(name="jet", lut=256):
    cmaplist = list(colormaps._cmaps)
    # cmaplist.sort(key=lambda x: x.upper())
    if lut > 256:
        lut = 256
    if lut < 1:
        lut = 1
    if name in cmaplist:
        return colormaps[name].resampled(lut)
    # elif name in diverging:
    #     return LinearSegmentedColormap.from_list(name, diverging[name]).resampled(lut)
    # elif name in sequential:
    #     return LinearSegmentedColormap.from_list(name, seq[name]).resampled(lut)
    # elif name in pal:
    #     return ListedColormap(pal[name], name = name).resampled(lut)
    else:
        return colormaps["jet"].resampled(lut)

